description:
As a group of old high school friends wander through San Francisco on Halloween night, two of them are forced to confront their unspoken sexual history.

The film explores the subtleties of loneliness, friendship, and sexuality with this tale of two high school friends who are forced to face their unspoken sexual history while wandering the streets of San Francisco on Halloween night...
